k\&quot;);\ncy.get(\&quot;#facebook_link\&quot;).prev().should(\&quot;be.visible\&quot;).and(\&quot;have.text\&quot;, \&quot;Links\&quot;);\ncy.get(\&quot;#instagram_link\&quot;).should(\&quot;be.visible\&quot;).and(\&quot;have.attr\&quot;, \&quot;href\&quot;, \&quot;https://www.instagram.com/techglobal.school/?hl=en\&quot;).and(\&quot;have.text\&quot;, \&quot;Instagram\&quot;);\n/**\n* 1. Go to &#x27;https://techglobal-training.com/frontend&#x27;\n* 2. Click on the &#x27;Html Elements&#x27; card\n* 3. From the \&quot;Checkboxes\&quot; section\n* 4. Validate \&quot;Tesla\&quot; checkbox text is equal to \&quot;Tesla\&quot;\n* 5. Validate \&quot;Tesla\&quot; checkbox is enabled\n* 6. Validate \&quot;Tesla\&quot; checkbox is not checked\n* 7. Check on \&quot;Tesla\&quot; checkbox\n* 8. Validate its checked\n*/\ncy.get(\&quot;#tesla_check\&quot;).should(\&quot;have.text\&quot;, \&quot;Tesla\&quot;).prev().and(\&quot;be.enabled\&quot;).and(\&quot;be.not.checked\&quot;).check().and(\&quot;be.checked\&quot;);&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;9085054c-201e-4df5-ad56-a3bab894608e&quot;,&quot;parentUUID&quot;:&quot;7504e3a6-8505-4c92-90b9-89e427b44f07&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;Practice 2&quot;,&quot;fullTitle&quot;:&quot;Practices Practice 2&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:1751,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:&quot;[\n    {\n        \&quot;title\&quot;: \&quot;Spec video recording\&quot;,\n        \&quot;value\&quot;: \&quot;videos/assertionsPractices.cy.js.mp4\&quot;\n    }\n]&quot;,&quot;code&quot;:&quot;/**\n* Test Case: Validate Dropdowns Functionality on TechGlobal Training Page\n* Go to https://techglobal-training.com/frontend\n* Select the \&quot;Dropdowns\&quot; card\n* Select the \&quot;MacBook Pro 13\&quot; option from the \&quot;Product\&quot;
